var edges = d3.range(param-1);

function progress (integero, expert_mode) {
	var progress = 				[false,false,false];
	var progress_line = 		[false,false];
	var current = 				[false,false,false];
	current [integero] = true;
	for  (i = 0; i < progress.length; i++) {
		if (i <= integero) {
			progress[i] = true;
		}}

	for  (i = 0; i < progress_line.length; i++) {
		if (i < integero) {
			progress_line[i] = true;
		}}

	var optionals = 			[false,false,false];
	var optionals_line = 		[false,false];
	var hide_easy_mode = 		[false,false]
	if (integero > 3) {
		if (! expert_mode) {

				optionals_line[3] = true;
				optionals[4] = true;
				optionals_line[4] = true;
				optionals[5] = true;
				optionals_line[5] = true; }

		if (expert_mode) {

				hide_easy_mode[3] = true;
				hide_easy_mode[4] = true;
				hide_easy_mode[5] = true; }



	} 

		return [progress, progress_line, current, optionals, optionals_line, hide_easy_mode];

}
